🇬🇧 September 4, 1870. As a consequence of the disastrous defeat of Sedan (which ended with tge surrender of Napoleon III), a group of republicans led by Léon Gambetta gathered at the Hôtel de Ville in Paris and proclaimed the restoration of the Republic. It was the birth of the French Third Republic and the end of the Second Empire.⠀
