ame";s:0:"";}i:103;a:1:{s:9:"owner_pic";s:0:"";}i:104;a:1:{s:2:"id";s:19:"2390907401604726523";}i:105;a:1:{s:10:"short_code";s:11:"CEuNZ07gH77";}i:106;a:1:{s:12:"created_time";i:1599238394;}i:107;a:1:{s:7:"caption";s:109:"#berwick #castle #rivertweed #tweed #picoftheday #instapic #dayout #staycation #river #ruins #bridge #history";}i:108;a:1:{s:14:"comments_count";i:0;}i:109;a:1:{s:11:"likes_count";i:0;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuNZ07gH77";}i:111;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118747708_634523224154765_8683143761159046732_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=nbmtPjmJGxIAX9wF3Jq&_nc_tp=18&oh=433507e4e94fad4c2768b5a3819b7990&oe=5F7DDC83";}i:112;a:1:{s:4:"type";s:5:"image";}i:113;a:1:{s:8:"owner_id";i:4467773861;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2390907374662539298";}i:118;a:1:{s:10:"short_code";s:11:"CEuNZb1n1gi";}i:119;a:1:{s:12:"created_time";i:1599238391;}i:120;a:1:{s:7:"caption";s:1379:"The last time I ran was on July 25, when I DNF’d at my own race, The Warriors UltraRun. My feet were a mess, plantar fasciitis, a condition I’ve had for years and can feel like running on glass. I’ve never treated it seriously because that means taking time off. So here I am. But I’m using this time to rehab much more than my feet. I’m convinced these injuries flow outward from deeper imbalances. Lucky I’m surrounded by enlightened souls… Thanks to @ebgiii for inspiring me to veganism and running to a higher vibe… Dr. @verusika for the treatment plan… and especially @tessghilaga, my wife and yoga teacher. When we met over 20 years ago, I was taking yoga classes five days a week at Jivamukti just to score points with her. It’s been a while, but it’s nice to be back on yoga. In this down time, I’ve been doing the Ashtanga Primary Series, and I’m doing it old school, 6 days a week, 1.5 hrs a day. It’s totally changing by body, building strength through my core, and opening the calves, legs, hip and back, the root cause, I suspect, of this dreaded condition. I’m hoping to make my return to the roads in about 4 weeks.

